import React from 'react';
import styles from '../styles/AboutUsPage.module.css';

function AboutUsPage() {
    return (
        <div className={styles.pageContainer}>
            <header className={styles.hero}>
                <h1>About Us</h1>
                <p>Learn about our mission and values.</p>
            </header>
            <section className={styles.content}>
                <p>At TravelNow, we are committed to making travel accessible to everyone. Our mission is to help you discover new destinations and experiences while making memories that last a lifetime.</p>
            </section>
        </div>
    );
}

export default AboutUsPage;
